import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter, Route, createBrowserRouter, createRoutesFromElements, RouterProvider } from 'react-router-dom';

import Login from './Login';
import Signup from './Signup';
import MyButton from './MyButton';
import ThankYou from './ThankYou';
import Createproj from './Createproj'
import TeamName from './TeamName'

const root = ReactDOM.createRoot(document.getElementById('root'));

const router = createBrowserRouter(
  createRoutesFromElements(
    <>
     <Route path="/" element={<MyButton />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path = "/createProject" element = {<Createproj/>}/>
          <Route path = "/createTeam" element = {<TeamName/>}/>
          <Route path="/ThankYou" element={<ThankYou />} />
          <Route path="/s" element={<Login />} />
          <Route path="/MyButton" element={<MyButton />} />

    </>
  )
)
root.render(
  <React.StrictMode>
    <RouterProvider router = {router}>
    <App />
    </RouterProvider>
  </React.StrictMode>
);

reportWebVitals();
